// 产品接口
import request from '@/utils/request'; // 查询产线

export function getDTOs(query) {
  return request({
    url: '/ems/dtProductLineReportWork',
    method: 'get',
    params: query
  });
} // 创建产线

export function postDTO(data) {
  return request({
    url: '/ems/dtProductLineReportWork',
    method: 'post',
    data: data
  });
} // 查询单个产线

export function getDTO(routeCode) {
  return request({
    url: "/ems/dtProductLineReportWork/".concat(routeCode),
    method: 'get'
  });
} // 更新产线

export function patchDTO(routeCode, data) {
  return request({
    url: "/ems/dtProductLineReportWork/".concat(routeCode),
    method: 'patch',
    data: data
  });
} // 删除

export function deleteDTO(data) {
  return request({
    url: "/ems/dtProductLineReportWork",
    method: 'delete',
    data: data
  });
} // 查询筛选出的产品列表

export function getProduct() {
  var query = {
    productType: 'batch'
  };
  return request({
    url: '/ems/dtProduct',
    method: 'get',
    params: query
  });
}
